up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Tõenäoliselt pead enne teenuse kasutamist kõigepealt registreeruma. Peale selle tegemist pead lubama Contact Form 7-l sinu konto nimel selle teenusega suhelda.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'Siin lehel saad hallata teenuseid, mis on Contact Form 7 kaudu kättesaadavad. API kasutamine võimaldab saadaolevate teenustega koostööd teha.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'E-kirja-silt on nurksulgudega ümbritsetud lühike kood, mida saad kasutada igas "E-kiri" ja "E-kiri (2)" väljas. E-kirja-silt näitab kasutaja poolt vastavale vormi-sildiga loodud sisendväljale sisestatud väärtust.','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Vormi-silt on nurksulgudega ümbritsetud lühike kood, mida kasutatakse vormi sisus. Üldjuhul sümboliseerib vormi-silt sisendvälja ning tema komponendid saab jaotada nelja osasse: tüüp, nimi, valikud ja väärtused. Contact Form 7 toetab mitut tüüpi vormi-silte, sealhulgas tekstiväljad, numbriväljad, kuupäeva väljad, valikkastid, raadionupud, menüüd, failide üleslaadimise väljad, TURVAKOODid ja küsimustiku väljad.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Lisaseaded</strong> annavad koha, kus saab selle kontaktivormi käitumist kohandada koodijuppide abil.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'<strong>Sõnumites</strong> saad muuta erinevaid selle kontaktivormi poolt kasutatavaid teateid. Need sõnumid on üsna lühikesed, näiteks valideerimise veateade, mida näeb siis, kui nõutud väli jäeti tühjaks.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>E-kiri (2)</strong> on lisamall, mis töötab sarnaselt E-kirjale. Erinevus on selles, et E-kiri (2) saadetakse vaid siis, kui E-kiri on edukalt saadetud.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>E-kiri</strong> on koht e-kirja malli halduseks (päis ja sõnumi sisu), mille see kontaktivorm saadab peale kasutajapoolset sõnumi teelesaatmist. Siin saad kasutada Contact Form 7-me e-kirja-silte.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Vorm</strong> on HTML vormi sisu. Võid kasutada suvalist HTML-i, mis on vormielemendi sees lubatud. Siin võid kasutada ka Contact Form 7-me vormi-silte.','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Pealkiri</strong> on kontaktivormi pealkiri. Seda pealkirja kasutatakse ainult kontaktivormi nimesildina ning seda saab muuta.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'Siin vaates saad kontaktivormi muuta. Kontaktivorm koosneb järgnevatest komponentidest:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Loo duplikaat</strong> - kloonib kontaktivormi. Kloonitud kontaktivormil on sama sisu, mis originaalil, kuid erinev ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Muuda</strong> - viib selle kontaktivormi muutmise vaatesse. Selle vaateni jõuab ka kontaktivormi pealkirjal klõpsates.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Kontaktivormis hiirt rea kohal hoides näed tegevuslinke oma kontaktivormide haldamiseks. Saad teha järgnevaid toiminguid:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'Siin vaates saad hallata Contact Form 7 kontaktivorme. Hallatavate kontaktivormide arv on piiramatu. Igal kontaktivormil on unikaalne ID ja Contact Form 7 lühikood ([contact-form-7 ...]). Kontaktivormi postitusse või tekstimoodulisse lisamiseks pane sinna see lühikood.','Mail-tags'=>'E-kirja-sildid','Form-tags'=>'Vormi-sildid','Available Actions'=>'Võimalikud tegevused','Overview'=>'Ülevaaade','You can add customization code snippets here. For details, see %s.'=>'Siia saab lisada kohandamise koodijuppe. Täpsema info jaoks vaata %s.','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Manustatud failid','Use HTML content type'=>'Kasuta HTML-i sisu tüüpi','Exclude lines with blank mail-tags from output'=>'Jäta tühjad e-kirja-sildid väljundist välja','Message body'=>'Sõnumi sisu','Additional headers'=>'Veel päiseid','Subject'=>'Teema','From'=>'Saatja','To'=>'Saaja','In the following fields, you can use these mail-tags:'=>'Järgnevatel väljadel saad kasutada neid e-kirja-silte:','Mail (2) is an additional mail template often used as an autoresponder.'=>'E-kiri (2) on lisamall, mida kasutatakse tihti automaatvastuste jaoks.','Use Mail (2)'=>'Kasuta teist e-kirja','Mail (2)'=>'E-kiri (2)','Y/m/d'=>'Y/m/d','Edit &#8220;%s&#8221;'=>'Muuda &#8220;%s&#8221;','Edit'=>'Muuda','Date'=>'Kuupäev','Author'=>'Autor','Shortcode'=>'Lühikood','Title'=>'Pealkiri','Additional Settings'=>'Lisaseaded','Additional Settings (%d)'=>'Lisaseaded (%d)','Messages'=>'Teated','Mail'=>'Email','Form'=>'Vorm','Support'=>'Tugi','https://contactform7.com/support/'=>'https://contactform7.com/support/','FAQ'=>'KKK','https://contactform7.com/faq/'=>'https://contactform7.com/faq/','Docs'=>'Dokumentatsioon','https://contactform7.com/docs/'=>'https://contactform7.com/docs/','You are about to delete this contact form.
  \'Cancel\' to stop, \'OK\' to delete.'=>'Kas soovid kustutada kontaktivormi?','Delete'=>'Kustuta','Duplicate'=>'Loo duplikaat','Status'=>'Olek','You can also use this old-style shortcode:'=>'Võid kasutada ka seda vanas stiilis lühikoodi:','Copy this shortcode and paste it into your post, page, or text widget content:'=>'Kopeeri see lühikood ning aseta ta oma postituse, lehe või mooduli sisusse:','Enter title here'=>'Sisesta pealkiri siia','Save'=>'Salvesta','You are not allowed to edit this contact form.'=>'Sul ei ole õigusi selle kontaktivormi muutmiseks.','https://contactform7.com/save-submitted-messages-with-flamingo/'=>'https://contactform7.com/save-submitted-messages-with-flamingo/','https://contactform7.com/spam-filtering-with-akismet/'=>'https://contactform7.com/spam-filtering-with-akismet/','Setting up mail'=>'E-kirja seadistus','https://contactform7.com/setting-up-mail/'=>'https://contactform7.com/setting-up-mail/','https://contactform7.com/donate/'=>'https://contactform7.com/donate/','Contact Form 7 needs your support.'=>'Contact Form 7 vajab sinu abi.','Dismiss'=>'Peida','<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href="%3$s">update WordPress</a> first.'=>'<strong>Contact Form 7 %1$s vajab WordPressi versiooni %2$s või kõrgemat.</strong> Palun <a href="%3$s">uuenda WordPressi</a> enne.','Settings'=>'Seaded','Contact form deleted.'=>'Kontaktivorm on kustutatud.','Contact form saved.'=>'Kontaktivorm on salvestatud.','Contact form created.'=>'Kontaktivorm on loodud.','Search Contact Forms'=>'Otsi kontaktivormidest','Search results for &#8220;%s&#8221;'=>'Otsingutulemused sõnale &#8220;%s&#8221;','The changes you made will be lost if you navigate away from this page.'=>'Tehtud muudatused lähevad lehelt lahkumisel kaotsi.','Error in deleting.'=>'Viga kustutamisel.','You are not allowed to delete this item.'=>'Sul pole õigusi selle kustutamiseks.','You are not allowed to edit this item.'=>'Sul pole õigusi selle muutmisek